import React, { useState, useEffect, useRef } from 'react';
import { jsPDF } from 'jspdf';
import 'jspdf-autotable';

const SalesReport = () => {
  const [salesData, setSalesData] = useState([]);
  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');
  const [totalRevenue, setTotalRevenue] = useState(0);
  const [error, setError] = useState(null);
  const reportRef = useRef(null);

  useEffect(() => {
    if (startDate && endDate) {
      fetchSalesData();
    }
  }, [startDate, endDate]);

  const fetchSalesData = () => {
    const xhr = new XMLHttpRequest();
    xhr.open('POST', 'http://localhost/e_eat/fetch_revenue.php', true);
    xhr.setRequestHeader('Content-Type', 'application/x-www-form-urlencoded');
    xhr.onload = function () {
      if (xhr.status === 200) {
        const response = JSON.parse(xhr.responseText);
        if (response.error) {
          setError(response.error);
        } else {
          setSalesData(response);
          calculateTotalRevenue(response);
          setError(null);
        }
      } else {
        setError('Failed to fetch sales data');
      }
    };
    xhr.send(`start_date=${encodeURIComponent(startDate)}&end_date=${encodeURIComponent(endDate)}`);
  };

  const calculateTotalRevenue = (data) => {
    const allRevenues = Object.values(data).flatMap(itemData => itemData.revenues);
    const total = allRevenues.reduce((sum, revenue) => sum + parseFloat(revenue) / 100, 0);
    setTotalRevenue(total);
  };
//generating our pdf manej using jspdf autotable
  const generatePDF = () => {
    const doc = new jsPDF();
    const reportElement = reportRef.current;
  
     //logo redu in base64 encoding
    const logoUrl = 'data:image/png;base64,'; 
    doc.addImage(logoUrl, 'PNG', 14, 8, 50, 20); //location of the image
   
   
    doc.setFontSize(18);

    const starting_x_position = 80;
    doc.text('TCFL Canteen', starting_x_position, 10); 
    doc.text('Sales Report', starting_x_position, 20);
   
    doc.setFontSize(12);
    doc.text(`Date Range: ${startDate} to ${endDate}`, starting_x_position, 30); 
    
    doc.setFontSize(10);
  
    if (reportElement) {
      const table = reportElement.querySelector('table');
      if (table && table.rows.length > 0) { 
        doc.autoTable({ html: table, startY: 40 });  
        doc.text(`Total Revenue: ZIG${totalRevenue.toFixed(2)}`, 14, doc.lastAutoTable.finalY + 10);
        doc.save(`SalesReport_${startDate}_to_${endDate}.pdf`);
      } else {
        setError('No table data available for PDF generation');
      }
    } else {
      setError('Report element is not available');
    }
  };
  

  return (
    <div className='sales_report'>
      <h3>Select Date Range to Generate Sales Report</h3>
      <div className='date_range_inputs_container'>
        <input
          type="date"
          value={startDate}
          onChange={(e) => setStartDate(e.target.value)}
          placeholder="Start Date"
        />
        <input
          type="date"
          value={endDate}
          onChange={(e) => setEndDate(e.target.value)}
          placeholder="End Date"
        />
      </div>
      <button
        onClick={() => {
          setStartDate('');
          setEndDate('');
          setSalesData([]);
          setTotalRevenue(0);
        }}
        className='clear_sales_info'
      >
        Clear
      </button>
      {error && <p>Error: {error}</p>}
      
      {salesData && Object.keys(salesData).length > 0 && (
        <>
          <div ref={reportRef}>
            <h2>Sales Report</h2>
            <table>
              <thead>
                <tr>
                  <th>Item Name</th>
                  {/* <th>Date</th> */}
                  <th>Quantity Sold</th>
                  <th>Revenue (ZIG)</th>
                </tr>
              </thead>
              <tbody>
                {Object.entries(salesData).map(([itemName, data], index) => (
                  <tr key={index}>
                    <td>{itemName}</td>
                    {/* <td>{data.dates.join(', ')}</td> */}
                    <td>{data.revenues.length}</td>
                    <td>{(data.revenues.reduce((sum, rev) => sum + parseFloat(rev), 0) / 100).toFixed(2)}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
          <div>
            <p className="total_revenue">Total Revenue: ZIG{totalRevenue.toFixed(2)}</p>
            <button onClick={generatePDF} className='download_pdf_button'>Download PDF</button>
          </div>
        </>
      )}
    </div>
  );
};

export default SalesReport;
